      _ ->
	  case Key band 7 of
	    0 ->
		skip_varint_FixedLoan(Rest, 0, 0, F@_1, F@_2, F@_3,
				      TrUserData);
	    1 ->
		skip_64_FixedLoan(Rest, 0, 0, F@_1, F@_2, F@_3,
				  TrUserData);
	    2 ->
		skip_length_delimited_FixedLoan(Rest, 0, 0, F@_1, F@_2,
