		      end,
		  amount =
		      if NFamount =:= undefined -> PFamount;
			 true -> NFamount
		      end,
		  interest =
		      if NFinterest =:= undefined -> PFinterest;
			 true -> NFinterest
		      end}.

-compile({nowarn_unused_function,merge_msg_FixedSubscription/3}).
merge_msg_FixedSubscription(#'FixedSubscription'{type =
						     PFtype,
						 username = PFusername,
						 company = PFcompany,
