-compile({nowarn_unused_function,merge_msg_Auction/3}).
merge_msg_Auction(#'Auction'{type = PFtype,
			     company = PFcompany, amount = PFamount,
			     interest = PFinterest},
		  #'Auction'{type = NFtype, company = NFcompany,
			     amount = NFamount, interest = NFinterest},
